import React, { useRef } from 'react';
import emailjs from '@emailjs/browser';
import FormComponent from './components/FormComponent/FormComponent';
import FieldTypes from './components/FormComponent/FieldComponent/FieldTypes/FieldTypes';

function ContactUs() {

    const Fields = {
        sections: [
            {
                SectionName: "Personal Info",
                information: "",
                Fields: [
                    {
                        Identifier: 'from_name',
                        Text: 'First & Last Name:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'Adress',
                        Text: 'Mailing Address:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'PhoneNumber',
                        Text: 'Phone Number:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'user_email',
                        Text: 'Email:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                ]
            },
            {
                SectionName: "Education",
                information: "",
                Fields: [
                    {
                        Identifier: 'Degree1',
                        Text: 'Degree Earned:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'School1',
                        Text: 'School Attended:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'Years1',
                        Text: 'Years Attended:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Type: FieldTypes.DIVIDER
                    },
                    {
                        Identifier: 'Degree2',
                        Text: 'Degree Earned:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'School2',
                        Text: 'School Attended:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                    {
                        Identifier: 'Years2',
                        Text: 'Years Attended:',
                        Placeholder: '',
                        Type: FieldTypes.INPUT_TEXT
                    },
                ]
            },
            {
                SectionName: "Experience",
                Information: "List up to 4 most recent/relevant jobs):",
                Fields: [
                    {
                        Identifier: 'Job1',
                        Text: 'Job Information:',
                        InformationList: ['Employer', 'Job Title', 'Date Range', 'Key Job Duties'],
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                    {
                        Type: FieldTypes.DIVIDER
                    },
                    {
                        Identifier: 'Job2',
                        Text: 'Job Information:',
                        InformationList: ['Employer', 'Job Title', 'Date Range', 'Key Job Duties'],
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                    {
                        Type: FieldTypes.DIVIDER
                    },
                    {
                        Identifier: 'Job3',
                        Text: 'Job Information:',
                        InformationList: ['Employer', 'Job Title', 'Date Range', 'Key Job Duties'],
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                    {
                        Type: FieldTypes.DIVIDER
                    },
                    {
                        Identifier: 'Job4',
                        Text: 'Job Information:',
                        InformationList: ['Employer', 'Job Title', 'Date Range', 'Key Job Duties'],
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                ]
            },
            {
                SectionName: "Other",
                Information: "",
                Fields: [
                    {
                        Identifier: 'InvolvementOrganization',
                        Text: '1.) Are you involved in any organizations or take on any sort of leadership role outside of work? (for example, volunteer work)',
                        InformationList: ['Organization', 'Role', 'Date Range', 'Key Duties/Accomplishments'],
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                    {
                        Type: FieldTypes.DIVIDER
                    },
                    {
                        Identifier: 'Awards',
                        Text: '2.) Do you hold any certifications or awards?',
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                    {
                        Type: FieldTypes.DIVIDER
                    },
                    {
                        Identifier: 'AdditionalInformation',
                        Text: '3.) Is there any additional information that you feel should be included on your resume but that none of the above questions addressed specifically?',
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                ]
            },
            {
                SectionName: "Skills",
                Information: "",
                Fields: [
                    {
                        Identifier: 'Languages',
                        Text: '1.) Do you read/write/speak any language other than English?',
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                    {
                        Identifier: 'UniqueSkills',
                        Text: '2.) Do you have any unique or special skills? If yes, please provide them here:',
                        Placeholder: '',
                        Type: FieldTypes.TEXTAREA
                    },
                ]
            }
        ]
    }

    function sanitizeString(str) {
        if ((str === null) || (str === ''))
            return false;
        else
            str = str.toString();

        return str.replace(/(<([^>]+)>)/ig, '');
    }

    const formData = useRef();
    function sendEmail(e) {
        e.preventDefault();
        let concattedBody = "";
        Fields.sections.forEach(section => {
            concattedBody += `<h3>${section.SectionName}<h3>`;
            section.Fields.forEach(sectionField => {
                let Identifier = sectionField.Identifier;
                if (Identifier) {
                    let elementValue = e.target.elements[Identifier].value;
                    if (elementValue === "") return;
                    concattedBody += `<p><b> ${sanitizeString(sectionField.Text)} </b> ${sanitizeString(elementValue)}</p>`;

                }
            })
        })
        e.target.elements.message.value = concattedBody;
        console.log(concattedBody);
        // emailjs.sendForm('service_ey81c06', 'template_1rlbuup', formData.current, 'Hudm_HPE7Tvg54jDU')
        //     .then((result) => {
        //         console.log(result.text);
        //     }, (error) => {
        //         console.log(error.text);
        //     });
    };


    return (
        <>
            <h1> Resume Form </h1>
            <FormComponent form={formData} onsubmit={sendEmail} fielddata={Fields} />
        </>
    );
};

export default ContactUs;
